DROP TABLE IF EXISTS "public"."tb_region";
CREATE TABLE "public"."tb_region"(
    "id" bigserial NOT NULL PRIMARY KEY,
    "cid" varchar(10) NOT NULL UNIQUE,
    "cname" varchar(50) NOT NULL,
    "pid" varchar(10) NOT NULL,
    "pname" varchar(30) NOT NULL,
    "status" smallint NOT NULL DEFAULT '1',
    "created" timestamp(6) NOT NULL DEFAULT now(),
    "updated" timestamp(6) NOT NULL DEFAULT now(),
    "level" int2 NOT NULL DEFAULT '1'
);

COMMENT ON COLUMN "public"."tb_region"."id" IS '主键';
COMMENT ON COLUMN "public"."tb_region"."cid" IS '省份、城市、区县编号';
COMMENT ON COLUMN "public"."tb_region"."cname" IS '省份、城市、区县名称';
COMMENT ON COLUMN "public"."tb_region"."pid" IS '父级省份、城市、区县编号';
COMMENT ON COLUMN "public"."tb_region"."pname" IS '父级省份、城市、区县名称';
COMMENT ON COLUMN "public"."tb_region"."status" IS '0无效 1有效';
COMMENT ON COLUMN "public"."tb_region"."created" IS '创建时间';
COMMENT ON COLUMN "public"."tb_region"."updated" IS '创建时间';
COMMENT ON COLUMN "public"."tb_region"."level" IS '级别(省-1级、市-2级、区/县-3级)';
COMMENT ON TABLE "public"."tb_region" IS '全国行政省市区信息表';

